import colorLogo from '../images/color-logo-tinder.png'

const Nav = ({ minimal }) => {

    return (
        <nav>
            <div className="logo-container">
                <img className="logo" src={minimal ? colorLogo : whiteLogo} />
            </div>
        </nav>
    );
}

export default Nav;
